import React from 'react';
import logo from '../assets/logo.png';

class TopBar extends React.Component {
  render() {
    return (
      <div className="bg-white shadow-sm mb-2">
        <img src={logo} width="60" alt="Hoaxify" />
      </div>
    );
  }
}

export default TopBar;
